import React from "react";
import {FaHome,FaHashtag,FaBell,FaEnvelope,FaSearch,FaChevronDown} from "react-icons/fa";

function NavBar(){
    return (
        <nav className="feeds-nav">
            <div className="icons">
                <a href="#" className="active" ><FaHome/></a>
                <a href="" ><FaHashtag/></a>
                <a href="" ><FaBell/></a>
                <a href="" ><FaEnvelope/></a>
            </div>

            <div className="search-bar">
                <FaSearch/>
                <input type="test" id="recherche" name="fname" placeholder="Recherche ..."  className="search-bar-input"/>
                <input  id="contact" type="checkbox" value="checked" name="contact" style="vertical-align: middle;" aria-label="Order 145. On selection a new window will be opened." title="Amis uniquement"/>
                <input type="submit" id="submit" name="submit"/>

            </div>


        </nav>
    )
}
